import React from "react";

import './style.css'

const CategoryView = ( props ) =>{
    const { data } = props
    if(data.view_type === "cells_auto_fill"){
        const { items } = data
        return(<div className="cell-top-fill">
              {
                  items.length > 0 ? 
                  items.map(el=> <img alt="" src={el.img} key={el.id}/>)
                  : ''
              }
        </div>)
    }else if( data.view_type === "category_title"){
        const { items } = data
        return (<div>
            {
                  items.length > 0 ? 
                  items.map(el=> <div className="category_title" key={el.id}><span>{el.category_title}</span></div>)
                  : ''
              }
        </div>)
    }else if( data.view_type === "category_group" ){
        const { items } = data
        return(
            <div>
                {items.length > 0 ? 
                items.map(el=><div key={el.id} className="category_group_expand">
                    <a className="exposure-item" href="/main">
                        <img src={el.img} alt=""/>
                        <div className="pro-right">
                            <div>{el.product.title}</div>
                            <div>{el.product.pri}</div>
                        </div>
                    </a>
                </div>)
                :''}
            </div>
        )
    }
}

export default CategoryView
